from flask_restplus import fields

def auth_details(api):
    return api.parser().add_argument('Authorization', help="Your Authorization Token in the form '<AUTH_TOKEN>'", location='headers')

def update_user(api):
    return api.model('update_user', {
    'password': fields.String(required=True, example='SamplePassword'),
    'email': fields.String(required=True, example='peter@gmail.com'),
    'phone_number': fields.String(required=True, example='0412345678')
    })

def post_facility(api):
    return api.model('post_facility', {
    'property_id': fields.Integer(required=True, example='1'),
    'toothbrush': fields.Integer(required=True, example='1'),
    'towel': fields.Integer(required=True, example='1'),
    'bathtub': fields.Integer(required=True, example='1'),
    'hot_water': fields.Integer(required=True, example='1'),
    'television': fields.Integer(required=True, example='1'),
    'air_conditioner': fields.Integer(required=True, example='1'),
    'fridge': fields.Integer(required=True, example='1'),
    'washing_machine': fields.Integer(required=True, example='1'),
    'wifi': fields.Integer(required=True, example='1'),
    'heater': fields.Integer(required=True, example='1'),
    'elevator': fields.Integer(required=True, example='1')
    })

def post_booking(api):
    return api.model('post_booking', {
    'property_id': fields.Integer(required=True, example='1'),
    'checkin_date': fields.String(required=True, example='2019-10-21'),
    'checkout_date': fields.String(required=True, example='2019-10-26'),
    'tenant_id': fields.Integer(required=True, example='1')#,
    #'payment_id': fields.Integer(required=True, example='1')
    })

def post_review(api):
    return api.model('post_review', {
    'user_id': fields.Integer(required=True, example='1'),
    'property_id': fields.Integer(required=True, example='1'),
    'date': fields.String(required=True, example='2019-10-31'),
    'rating': fields.Integer(required=True, example='5'),
    'review': fields.String(required=True, example='Very good bedroom!')
    })

def post_accomodation(api):
    return api.model('post_accomodation', {
    'landlord_id': fields.Integer(required=True, example='1'),
    'city': fields.String(required=True, example='Sydney'),
    'suburb': fields.String(required=True, example='Randwick'),
    'location': fields.String(required=True, example='100 York Street'),
    'rent_type': fields.String(required=True, example='Whole House'),
    'num_bedroom': fields.Integer(required=True, example='3'),
    'num_livingroom': fields.Integer(required=True, example='1'),
    'num_bathroom': fields.Integer(required=True, example='2'),
    'num_parking': fields.Integer(required=True, example='3'),
    'property_area': fields.Integer(required=True, example='100'),
    'property_title': fields.String(required=True, example='3 bedroom house'),
    'property_description': fields.String(required=True, example='very good'),
    'transport_description': fields.String(required=True, example='3 bus'),
    'nearby_facilities': fields.String(required=True, example='5 schools and 7 hospitals'),
    'price': fields.Integer(required=True, example='50'),
    'bond': fields.Integer(required=True, example='300'),
    'cleaning_fee': fields.Integer(required=True, example='0'),
    'additional_fee': fields.Integer(required=True, example='0'),
    'minimal_period': fields.Integer(required=True, example='3'),
    'max_period': fields.Integer(required=True, example='365'),
    'additional_request': fields.String(required=True, example='No parsley, extra spicy')
    })

def post_picture(api):
    return api.model('post_picture', {
    'property_id': fields.Integer(required=True, example='1'),
    'room_name': fields.String(required=True, example='Bedroom'),
    'image': fields.String(required=True, example='data:image/jpeg;base64,')
    })